import React, { useState } from 'react';

const SlotManagement = () => {
  const [slots, setSlots] = useState([
    { id: 1, number: 'A-01', type: 'REGULAR', floor: 1, rate: 5.00, status: 'AVAILABLE' },
    { id: 2, number: 'A-02', type: 'VIP', floor: 1, rate: 12.00, status: 'OCCUPIED' },
    { id: 3, number: 'B-01', type: 'HANDICAPPED', floor: 2, rate: 5.00, status: 'AVAILABLE' },
    { id: 4, number: 'B-02', type: 'ELECTRIC_VEHICLE', floor: 2, rate: 8.00, status: 'MAINTENANCE' }
  ]);

  const [showAddModal, setShowAddModal] = useState(false);
  const [editingSlot, setEditingSlot] = useState(null);

  const getStatusColor = (status) => {
    switch (status) {
      case 'AVAILABLE': return 'bg-green-100 text-green-800';
      case 'OCCUPIED': return 'bg-red-100 text-red-800';
      case 'MAINTENANCE': return 'bg-yellow-100 text-yellow-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  const getTypeIcon = (type) => {
    switch (type) {
      case 'VIP': return 'üëë';
      case 'HANDICAPPED': return '‚ôø';
      case 'ELECTRIC_VEHICLE': return 'üîå';
      default: return 'üöó';
    }
  };

  const handleStatusChange = (slotId, newStatus) => {
    setSlots(slots.map(slot => 
      slot.id === slotId ? { ...slot, status: newStatus } : slot
    ));
  };

  const handleRateChange = (slotId, newRate) => {
    setSlots(slots.map(slot => 
      slot.id === slotId ? { ...slot, rate: parseFloat(newRate) } : slot
    ));
  };

  return (
    <div className="space-y-6">
      <div className="flex items-center justify-between">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">Slot Management</h1>
          <p className="text-gray-600">Manage parking slots, pricing, and availability</p>
        </div>
        <button 
          onClick={() => setShowAddModal(true)}
          className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700"
        >
          Add New Slot
        </button>
      </div>

      {/* Slot Statistics */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
        <div className="card p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Total Slots</p>
              <p className="text-2xl font-bold text-gray-900">{slots.length}</p>
            </div>
            <div className="text-2xl">üÖøÔ∏è</div>
          </div>
        </div>

        <div className="card p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Available</p>
              <p className="text-2xl font-bold text-green-600">
                {slots.filter(s => s.status === 'AVAILABLE').length}
              </p>
            </div>
            <div className="text-2xl">‚úÖ</div>
          </div>
        </div>

        <div className="card p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Occupied</p>
              <p className="text-2xl font-bold text-red-600">
                {slots.filter(s => s.status === 'OCCUPIED').length}
              </p>
            </div>
            <div className="text-2xl">üöó</div>
          </div>
        </div>

        <div className="card p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Maintenance</p>
              <p className="text-2xl font-bold text-yellow-600">
                {slots.filter(s => s.status === 'MAINTENANCE').length}
              </p>
            </div>
            <div className="text-2xl">üîß</div>
          </div>
        </div>
      </div>

      {/* Slots Table */}
      <div className="card overflow-hidden">
        <div className="px-6 py-4 border-b border-gray-200">
          <h3 className="text-lg font-semibold text-gray-900">All Parking Slots</h3>
        </div>

        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Slot</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Type</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Floor</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Rate</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Status</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Actions</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {slots.map((slot) => (
                <tr key={slot.id}>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="flex items-center">
                      <span className="text-lg mr-2">{getTypeIcon(slot.type)}</span>
                      <span className="font-medium text-gray-900">{slot.number}</span>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {slot.type.replace('_', ' ')}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    Floor {slot.floor}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <input
                      type="number"
                      value={slot.rate}
                      onChange={(e) => handleRateChange(slot.id, e.target.value)}
                      className="w-20 px-2 py-1 border border-gray-300 rounded text-sm"
                      step="0.50"
                      min="0"
                    />
                    <span className="text-sm text-gray-500 ml-1">/hr</span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <select
                      value={slot.status}
                      onChange={(e) => handleStatusChange(slot.id, e.target.value)}
                      className={`px-2 py-1 rounded-full text-xs font-medium border-0 ${getStatusColor(slot.status)}`}
                    >
                      <option value="AVAILABLE">Available</option>
                      <option value="OCCUPIED">Occupied</option>
                      <option value="MAINTENANCE">Maintenance</option>
                    </select>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium">
                    <button 
                      onClick={() => setEditingSlot(slot)}
                      className="text-blue-600 hover:text-blue-900 mr-3"
                    >
                      Edit
                    </button>
                    <button className="text-red-600 hover:text-red-900">
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default SlotManagement;
